import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state={
      loggedIn: false
    }
  }
  login=(e)=>{
    e.preventDefault();
    console.log("hey")
  }
  render() {
    return (
      <div className="App">
  <h1>Hi</h1>
  <form onSubmit={this.login}>
    <input type="text" name="username"/>
    <input type="submit"/>
  </form>



      </div>
    );
  }
}

export default App;
